import car1 from "./assets/abarth-logo.png";
import car2 from "./assets/acura-logo.png";
import car3 from "./assets/alpine-logo.png";
import car4 from "./assets/aston-martin-logo.png";
const Carsimg = [
    { 
        imgsrc: car1,
        title: "Abarth",
        Link:"/Ford",
    },
    { 
        imgsrc: car2,
        title: "Acura",
        Link:"/Ford",
    },
    { 
        imgsrc: car3,
        title: "Alpine",
        Link:"/Ford",
    },
    { 
        imgsrc: car4,
        title: "Aston Martin",
        Link:"/Ford",
    },
];

export default Carsimg;
